public class InnerListenerRuleActionFactory(Action<Humidifier.ElasticLoadBalancingV2.ListenerRuleTypes.Action> factoryAction = null) : SubResourceFactory<Humidifier.ElasticLoadBalancingV2.ListenerRuleTypes.Action>
{

    internal InnerListenerRuleFixedResponseConfigFactory FixedResponseConfigFactory { get; set; }

    internal InnerListenerRuleAuthenticateCognitoConfigFactory AuthenticateCognitoConfigFactory { get; set; }

    internal InnerListenerRuleRedirectConfigFactory RedirectConfigFactory { get; set; }

    internal InnerListenerRuleForwardConfigFactory ForwardConfigFactory { get; set; }

    internal InnerListenerRuleAuthenticateOidcConfigFactory AuthenticateOidcConfigFactory { get; set; }

    protected override Humidifier.ElasticLoadBalancingV2.ListenerRuleTypes.Action Create()
    {
        var actionResult = CreateAction();
        factoryAction?.Invoke(actionResult);

        return actionResult;
    }

    private Humidifier.ElasticLoadBalancingV2.ListenerRuleTypes.Action CreateAction()
    {
        var actionResult = new Humidifier.ElasticLoadBalancingV2.ListenerRuleTypes.Action();

        return actionResult;
    }
    public override void CreateChildren(Humidifier.ElasticLoadBalancingV2.ListenerRuleTypes.Action result)
    {
        base.CreateChildren(result);

        result.FixedResponseConfig ??= FixedResponseConfigFactory?.Build();
        result.AuthenticateCognitoConfig ??= AuthenticateCognitoConfigFactory?.Build();
        result.RedirectConfig ??= RedirectConfigFactory?.Build();
        result.ForwardConfig ??= ForwardConfigFactory?.Build();
        result.AuthenticateOidcConfig ??= AuthenticateOidcConfigFactory?.Build();
    }

} // End Of Class

